import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";

function HomePage() {
  return (
    <div className="background">
      <div className="logo"></div>
      <menu className="Menu">
        <div className="button-container">
          <Link to="/Craft" className="craft-button">Craft</Link>
          <Link to="/Recherche" className="recherche-button">Recherche</Link>
          <Link to="/BDD" className="bd-button">Base de donn√©e</Link>
        </div>
      </menu>
    </div>
  );
}

export default HomePage;
